import React, { useState } from 'react';
import testapi from './Testapi';



const testdata = () => {
    const [workData, setWorkData] = React.useState(testapi);
    console.log(workData);
    return (
        <>

            <section>
                <div classname="test-header">
                    <p>
                        <span classname="a">Popular tests</span>
                        <button><span classname="b">view all <i classname="fas fa-angle-double-right"></i></span></button>
                    </p>
                </div>
                <div classname="test-header-hr" ></div>
                <div classname="test-details-body" >
                    {workData.map((curElem) => {
                        const { id, head, testname, pretestinfo, home, reporttime, rate, ratebtn } = curElem;
                        return (
                            <>

                                <div classname="test-card col-md-4 col-lg-3">
                                    <div classname="a">{head}</div>
                                    <div classname="b">
                                        <div classname="b-1">
                                            <span classname="b-1-1">Test Name</span>
                                            <span classname="b-1-2">{testname}</span>
                                            <div classname="b-1-data">
                                                <span classname="b-1-4">Pre Test Information</span>
                                                <span classname="b-1-3">{pretestinfo}</span>
                                                <span classname="b-1-4">Home Collection</span>
                                                <span classname="b-1-3">{home}</span>
                                                <span classname="b-1-4">Reporting Time</span>
                                                <span classname="b-1-3">{reporttime}</span>
                                            </div>
                                        </div>
                                        <div classname="card-ammount">{rate}</div>
                                    </div>
                                    <div classname="c"><button>{ratebtn}</button></div>
                                </div>

                            </>
                        );
                    })}
                </div>
            </section>

        </>
    );
};


export default testdata;
